import React from 'react';
import './RecValue.css';
import Modal from '@material-ui/core/Modal';


const RecValue = props => {
    function renderData() {
        return props.concepts.map(item => (
            <tr key={item.id}>
                <td>{item.name}</td>
                <td>{item.value}</td>
            </tr>
        )
        )
    } 
        return (
            <Box component="span" m={1}>
            <table>
            <thead>
                <th>Ingredients</th>
                <th>Value</th>
            </thead>
            <tbody>
            {renderData()}
            </tbody>
            </table>
            </Box>
        )
    }

export default RecValue;
